import React from 'react'

const Home = () => {
  return (
    <div>
        <p className='header-btns'>
            <a href='/register' className='header-btn'>Register</a>
            <a href='/login' className='header-btn'>Login</a>
        </p>
    </div>
  )
}

export default Home
